import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Card from './Card.js';
// import App from './App';
import * as serviceWorker from './serviceWorker';
import 'tachyons';
import { robots } from './robots';

ReactDOM.render(
	<div>
		<Card />
		<Card />
		<Card />
		<Card />
	</div>,
	document.getElementById('root')
);
serviceWorker.register();
